import React from 'react'

import { useQuery } from '@tanstack/react-query'
import Axios from 'axios'

function Cat() {
    const { data: catData } = useQuery({
        queryKey: ["cat"],
        queryFn: async () => {
          return Axios.get("https://catfact.ninja/fact").then((res) => res.data);
        },
      });

  return (
    <div>
        <h1>{catData?.fact}</h1>
    </div>
  )
}

export default Cat
